function CSV_creationItem.GetValue(index, key)
	index = tostring(index)
	key = tostring(key)
    if creationItem[index] == nil then
        ZLog.Logger("Excel 获取表:creationItem  主键:".. index .." key:".. key.."出错!")
        return nil
    end
    if creationItem[index][key] == nil then
        ZLog.Logger("Excel 获取表: creationItem  主键:".. index .." key:".. key.."出错!")
        return nil
    end

    return creationItem[index][key]
end


function CSV_creationItem.Get()
    return creationItem
end

function CSV_creationItem.GetAllKeys()
    local keys = {}
    for k in pairs(creationItem) do
        keys[#keys + 1] = k
    end
    if #keys == 0 then
        ZLog.Logger(string.format("Excel 获取表: 所有主键出错"))
        return nil
    end
    return keys
end